            "Sağlık ve Nüfus Bakanlığı, uzmanlaşmış hastanelerde mültecilere ve sığınmacılara ücretsiz HIV/AIDS ve tüberküloz tedavisi sunar. Daha fazla bilgi için HIV/AIDS özel hattını arayabilirsiniz: 01100666471 Mısır Barınağı, ek testler, danışmanlık ve fırsatçı enfeksiyon tedavisi gibi ilgili hizmetler de sunar."),
        "healthA9": MessageLookupByLibrary.simpleMessage(
            "Sağlık Bakanlığı ve Nüfus Hizmetleri gibi kamu sağlık tesisleri, birinci basamak sağlık hizmetleri sunmak için Komisyon kartlarını kontrol etmez, aynı durum Sağlık Bakanlığı ve Nüfus Hizmetleri\'nin acil hizmetleri için de geçerlidir. Ancak, Komisyon\'un ortakları tarafından sağlanan yukarıdaki sağlık hizmetlerine erişmek için Komisyon\'a kayıt olmanız gerekmektedir (Caritas, Çocuk Kurtarma Kurumu ve Mısır Barınağı)."),
