        "learning": MessageLookupByLibrary.simpleMessage("Eğitim"),
        "learningA1": MessageLookupByLibrary.simpleMessage(
            "Çocuğunuz, Eğitim Bakanlığı tarafından denetlenen devlet okulları, özel okullar ve uluslararası okulları içeren resmi eğitim sistemi aracılığıyla okula kaydolabilir. Hükümet eğitimi şu anda Sudan, Güney Sudan, Yemen ve Suriye\'den gelen mültecilere ve sığınmacılara Mısırlılarla eşit koşullarda sunulmaktadır, ve Komisyon diğer mülteci uyruklarının da entegrasyonu için hükümetle çalışmaktadır."),
        "learningA10": MessageLookupByLibrary.simpleMessage(
            "Evet, UNHCR, Mısır\'daki kamu, özel ve toplum okullarına kayıtlı mülteci ve sığınmacı öğrencilere eğitim bursları sağlar, ortaöğretim çağındaki çocuklar için. UNHCR tarafından belirlenen ve her yıl haziran ayında duyurulan belirli kriterlere dayanarak eğitim bursu alabilirsiniz."),
        "learningA11": MessageLookupByLibrary.simpleMessage(
            "UNHCR, ihtiyaç analizi için Caritas Egypt isimli uygulama ortağı aracılığıyla özel ihtiyaçları olan çocuklara destek sağlar ve gerekirse onlar için uygun bir okul bulmak veya ek eğitim bursları gibi ek destek sağlar."),
        "learningA12part1": MessageLookupByLibrary.simpleMessage(
            "Üniversite öncesi ve üstü eğitim 18 yaşında başlar. Mısır\'da üst öğrenim şu anda Suriyeli, Yemenli ve Sudanlı mülteciler için mevcuttur."),
        "learningA12part2": MessageLookupByLibrary.simpleMessage(
            "Üniversite harçlarında istisnalar, vatandaşlığa ve ikincil eğitim sertifikasının türüne bağlı olarak Yükseköğretim Bakanlığı tarafından belirlenir. İstisnalar yılda bir kez yenilenir."),
        "learningA13": MessageLookupByLibrary.simpleMessage(
            "Hayır, UNHCR üniversite eğitimi için herhangi bir burs sağlamaz. Ancak, Alman Akademik Mültecilere Yardım Fonu (DAAD), mülteci öğrencileri Alman hükümeti tarafından desteklenen üniversitelerde kayıtlıdır. Programla ilgili bilgiler, yeni bir dönem kabul edildiğinde erken duyurulur."),
        "learningA14": MessageLookupByLibrary.simpleMessage(
            "Bu, çeşitli alanlarda (işletme, pazarlama, dil, programlama vb.) çeşitli kursları içeren çevrimiçi ücretsiz bir platformdur. Dünya çapındaki saygın üniversiteler ve diğer kurumlar tarafından sunulan, herhangi bir kursun sonunda bir sertifika verilmektedir. Mülteciler için Coursera"),
        "learningA15": MessageLookupByLibrary.simpleMessage(
            "Mülteciler, sığınma başvurucusu ve ayrıca bir e-posta adresine sahip olan ve İnternet\'e erişimi olan Mısırlılar başvurabilir. Başvurabilenler, başvuru formunu doldurabilir, programı bir toplum öğrenme merkezinde tamamlayabilir ve Nasr City ve Maadi\'deki toplum öğrenme merkezlerinden birinde bunu yapabilir. Bu davet şu anda yalnızca öncelikle kayıt yaptıran 18-35 yaş arası 200 mülteci, sığınma başvurucusu ve Mısırlılar için açıktır."),
        "learningA16": MessageLookupByLibrary.simpleMessage(
            "Evet, bazı kurslar Arapça\'ya çevrilmiştir, ancak sınavlar ve çoğu kurs İngilizce\'dir."),
        "learningA17part1": MessageLookupByLibrary.simpleMessage(
            "İnternet, dersi indirmek için sadece gereklidir: indirildikten sonra çevrimdışı olarak dersi tamamlayabilirsiniz. Coursera için bir uygulamanın olması nedeniyle, bir cep telefonu veya tablet, katılmak için yeterlidir ve bir bilgisayara gerek yoktur."),
        "learningA17part2": MessageLookupByLibrary.simpleMessage(
            "Seçilirseniz, UNHCR tarafından Tear De Zoom ile işbirliği yapılarak Maadi ve Nasr City\'deki toplum öğrenme merkezlerinde İnternet\'e erişebilirsiniz."),
        "learningA18": MessageLookupByLibrary.simpleMessage(
            "Bu bağlantıdaki başvuru formunu doldurmanız yeterlidir ve seçilirseniz bir görüşme alırsınız: https://qrgo.page.link/YftWz"),
