        "learningA2part8": MessageLookupByLibrary.simpleMessage(
            "Üç yıl boyunca başarıyla ortaöğretim sınavlarını geçen öğrenciler mezun olabilir ve Mısır okulundan bir sertifika alabilirler (Genel Lise Diploması)."),
        "learningA3": MessageLookupByLibrary.simpleMessage(
            "İkamet ettiğiniz idari eğitim bölgesindeki öğrenci işleri bürosuna gitmeniz gerekmektedir."),
        "learningA4part1":
            MessageLookupByLibrary.simpleMessage("Geçerli ikamet izni"),
        "learningA4part2": MessageLookupByLibrary.simpleMessage(
            "Çocuğunuzun Mısır\'a gelmeden önce katıldığı okulun önceden tanınmış okul sertifikası"),
        "learningA4part3": MessageLookupByLibrary.simpleMessage(
            "Yukarıdaki belgelerden hiçbirine sahip değilseniz, çocuğunuzun Mısır Eğitim Bakanlığı tarafından yapılan seviye tespit sınavına girmesi gerekmektedir"),
        "learningA5part1": MessageLookupByLibrary.simpleMessage(
            "Seviye tespit sınavları, eğitimlerini Mısır dışında alan öğrencilerin Mısır resmi okul sistemine hangi sınıfa kaydedileceklerini belirlemek için girmeleri gereken kısa sınavlardır."),
        "learningA5part2": MessageLookupByLibrary.simpleMessage(
            "Öğrenciler, geçerli bir ikamet izni ile ikamet ettikleri idari eğitim bölgesinin öğrenci işleri ve sınavlar departmanına gitmelidir. Departman, seviye tespit sınavlarını düzenleyecektir."),
        "learningA5part3": MessageLookupByLibrary.simpleMessage(
            "Seviye tespit sınavları ücretsizdir."),
        "learningA5part4": MessageLookupByLibrary.simpleMessage(
            "Sınavı başarıyla geçen öğrencilere, çocuğun belirtilen yaşını okula göndermek için bir kabul mektubu verilir. Bu mektup çocukların okullara kaydolmalarına yardımcı olur."),
        "learningA6": MessageLookupByLibrary.simpleMessage(
            "Okul sertifikasının yaşı iki yılı geçmemesi gerekir. Mısır eğitim otoritelerine sunulmalı ve Mısır okul sertifikalarıyla eşdeğer olup olmadığına karar verirler."),
        "learningA7": MessageLookupByLibrary.simpleMessage(
            "BM Mülteciler Yüksek Komiserliği\'ne kayıtlı olan ve aşağıdakilerden herhangi birine sahip olmadığı için çocuklarını okula kaydedemeyen kişiler: ikamet izni, mülteci kimlik kartı (sarı kart) veya pasaportlar: Çocuk için bir yer olduğunu onaylayan okuldan mühürlü bir mektup alın. Bu mektupla, eğitim bölümüne gidin ve onu mühürleyin. Kahire\'nin Abbasiya bölgesindeki Pasaportlar ve Göç İdaresi\'ne gidin. Orada, ne zaman ikamet almayı beklediğinizi belirten bir numara alacaksınız. Bu numarayı kullanarak, BM Mülteciler Yüksek Komiserliği\'ndeki kayıt kartınızın bir kopyasını ve okul tarafından sunulan mektubun bir kopyasını hazırlayın ve ikamet alınıncaya kadar muafiyet için bakanlıkla iletişime geçin. Çocuğunuzun kaydını geciktirmemek için, ikamet işlemlerini mümkün olan en kısa sürede tamamlayın."),
        "learningA8part1": MessageLookupByLibrary.simpleMessage(
            "Çocuklar, dokuz yaşına kadar olan milliyetlerine bağlı olarak kamu veya özel okullarda birinci sınıfa kadar kaydedilebilirler. Çocuk dokuz yaşından büyükse, okula kayıt olmadan önce yetişkin eğitimi kursuna kaydolması gerekecektir. Yetişkin eğitimi kursunu başarıyla tamamlayan ve yetişkin okuryazarlığı sertifikası alan öğrenci, uygun olması durumunda doğrudan hazırlık sınıfına kaydedilir."),
        "learningA8part2": MessageLookupByLibrary.simpleMessage(
            "Öğrenci, yaşına uygun olarak düzenli okula devam etmesine izin verilmiyorsa, ev eğitim sistemi aracılığıyla devam edecektir. Bu durumda, öğrenci uygun yerlerin mevcudiyetine göre bir devlet okuluna kaydedilecektir."),
        "learningA9part1": MessageLookupByLibrary.simpleMessage(
