        "rights": MessageLookupByLibrary.simpleMessage("Haklar"),
        "rightsA1": MessageLookupByLibrary.simpleMessage(
            "Sığınma başvurusunda bulunan ve mülteci statüsü veya koruma aldıkları için çeşitli haklara sahip olan kişilerin, bu hakların teminatını sağlayan ev sahibi devlet tarafından garantilendiği çeşitli haklar. Bu haklar, mültecilerin Haklar Sözleşmesi ve insan haklarına ilişkin antlaşmalarda belirtilmiştir. Bu haklar, sığınma talep ettikleri ülkede kalma ve kendi ülkelerine geri gönderilmeme (örneğin zorla geri gönderme) imkanını içerir ve eğitim, sağlık hizmetleri, konut, iş ve aile gibi diğer konuları kapsar."),
        "rightsA2": MessageLookupByLibrary.simpleMessage(
            "Mültecilerin korunması için gerekli standartları belirleyen uluslararası teamül hukuku ve uluslararası enstrümanların derlemesidir. 1951 tarihli Sığınmacılar Sözleşmesi ve 1967 tarihli Protokolü, sığınma hukukunun temel taşlarıdır. Sığınma hakkı ve insan hakları uluslararası hukuku birbirini tamamlar, aynı şekilde uluslararası insan hakları hukuku da uluslararası teamül hukuku ile birlikte gelir."),
        "rightsA3": MessageLookupByLibrary.simpleMessage(
            "Hayatları veya özgürlükleri tehlikede olan mülteciler, sığınma talebinde bulunanlar ve diğer kişiler için önemli bir haktır. Bu kişilerin, ev sahibi ülkeden kendi ülkelerine veya tehlike veya zarar görebilecekleri başka bir ülkeye herhangi bir şekilde geri gönderilmeme hakkı vardır. Bu hak, geri İade Yasağı olarak bilinen ve Sığınmacılar Sözleşmesi ve insan haklarına ilişkin diğer antlaşmalarda yer alan bir haktır. Aynı zamanda adet hukukunun bir parçasıdır ve dolayısıyla tüm ülkeler tarafından sağlanmalıdır."),
        "rightsA4": MessageLookupByLibrary.simpleMessage(
            "Mültecilerin korunması, mültecilerin haklarının tamamen saygı gösterilmesini sağlamayı amaçlayan tüm faaliyetleri kapsar. Koruma, insan onurunun saygı gösterildiği bir ortamın sağlanması, belirli bir kötü muamele modelinin doğrudan etkilerini önleme veya hafifletme ve tazminatlar ve rehabilite yoluyla onurlu yaşam koşullarını geri kazandırma işlemlerini içerir."),
        "rightsA5": MessageLookupByLibrary.simpleMessage(
            "Evet, mülteciler insan haklarından yararlanırlar. İnsan hakları genellikle, bir insanın sadece insan olması nedeniyle hak ettiği devredilemez haklar olarak anlaşılır. Bunlar evrensellik, eşitlik ve ayrımcılık yapmama gibi temel prensiplere dayanır ve onları tanımlayan ve tam kullanımlarını sağlamaya yardımcı olan anlaşmalar, adet hukuku, ulusal yasalar ve diğer standartlar tarafından kurulmuştur. İnsan hakları, HCR\'nin yetki alanına giren tüm kişilere uygulanır."),
        "rightsA6part1": MessageLookupByLibrary.simpleMessage(
            "1951 tarihli Sığınmacılar Sözleşmesi veya 1954 tarihli Sığınmasızlar Statüsü Sözleşmesi\'nin tarafı olan bir ülkede mülteci veya sığınmasız olarak, ulusal pasaportunuzun yerine geçmek üzere verilen \'Sözleşme Seyahat Belgesi\'ne sahip olma hakkınız vardır."),
        "rightsA6part2": MessageLookupByLibrary.simpleMessage(
            "Mülteci olarak, \'Sözleşme Seyahat Belgesi\' ile seyahat etmek, ulusal pasaportla seyahatten daha güvenlidir çünkü ülkenize zorla geri dönme karşısında korunursunuz."),
        "rightsA6part3": MessageLookupByLibrary.simpleMessage(
            "Pratikte, tüm ülkeler Sözleşme Seyahat Belgesi vermemekte, bununla yükümlü olmalarına rağmen. Bazı ülkeler mültecilere ve sığınmasızlara diğer seyahat belgeleri verir, örneğin yabancılar için pasaportlar veya seyahat için özel kimlik belgeleri."),
        "rightsA6part4": MessageLookupByLibrary.simpleMessage(
            "Bazı ülkelerde, başka seçenekleriniz olmadığında Kızılhaç Komitesi\'nden Acil Seyahat Belgesi almanıza yardımcı olabilir. Bu belge sadece tek bir seyahat için geçerlidir."),
